import {User} from "./User";


export const Users = (props) => {

    let users = props.usersData.map( (user)=> <User key={user.id} id={user.id} status={user.status} fullName={user.fullName} county={user.location.country} city={user.location.city}/>);

    return(

        <div>
            <div>
                {users}
            </div>
            USERS WILL BE HERE
        </div>
    );
}
